            {title: 'HTML&CSS', description: "Большое и длинное описание>"},
        ]};
    return (
        <div className={styles.skill}>
            <div className={styles.icon}>
                <img src="" alt=""/>
            </div>
            <span className={styles.title}>{state.tasks.title}</span>
            <span className={styles.description}>{state.tasks.description}</span>
        </div>

    );
}

export default Skill;
